        fetch('https://fakestoreapi.com/products')
        .then((res)=>res.json())
        .then((data)=>setprodact(data))
    },[])
const arr=prodact.map((el)=>
<div className="CardList">
<img src={el.image} alt="" />
</div>
)



    return(<div>
      {arr}
<div className="List">
   



</div>
</div>
    )
    }
